const DestinationDetails: React.FC = () => {
  const { id } = useParams<{ id: string }>();

  const formattedId = id?.toLowerCase().replace(/\s+/g, ""); // Ensure matching key format
  const destination = destinations[formattedId];

  if (!destination) {
    return (
      <Container className="mt-5 text-center">
        <h2 className="text-danger">Destination Not Found</h2>
        <p>Please check the URL and try again.</p>
      </Container>
    );
  }

  return (
    <Container className="mt-5">
      <h1>
        {destination.name}, {destination.country}
      </h1>
      <p className="lead">{destination.description}</p>

      <Row className="justify-content-center">
        <Col md={8} className="text-center">
          <img
            src={destination.image}
            alt={destination.name}
            className="img-fluid rounded mb-4"
            style={{ maxHeight: "400px" }}
          />
        </Col>
      </Row>

      <h2>Hotels</h2>
      <Row>
        {destination.hotels.map((hotel, index) => (
          <Col md={6} key={index} className="mb-4">
            <Card>
              <Card.Img
                variant="top"
                src={hotel.image || "https://via.placeholder.com/300"}
                alt={hotel.name}
              />
              <Card.Body>
                <Card.Title>{hotel.name}</Card.Title>
                <h5>${hotel.price}/night</h5>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default DestinationDetails;
